from bs4 import BeautifulSoup
import requests
import json
items_list=[]
for item in items:
    item_dict={}
    soup = BeautifulSoup(item, 'html.parser')
    item_dict['link'] = "https://alshamali.online"+ soup.find('a')['href']
    item_dict['title'] = soup.find('a')['title']
    item_dict['image'] = "https://alshamali.online"+ soup.find('img')['src']
    items_list.append(item_dict)

with open('alShamali/items.json', 'w') as f:
    json.dump(items_list, f, indent=4)